import axios from "axios";
import "./photos.scss";
const Photos = () => {
  const [dataPhotos, setDataPhotos] = useState()
  useEffect(() => {
    const FetchingDataPhotos = async()=>{
      const res = await axios.get("https://picsum.photos/v2/list");
      const data = res ? res.data : [];
      setDataPhotos(data)

    }
    FetchingDataPhotos()
  }, []);
  return (
    <div>
      <h2>Photos</h2>
    </div>
  );
};

export default Photos;
